import { Grid, Paper, Box, Typography } from "@material-ui/core";

const about = ()=>{
    return(<div>

        <Grid container justify='center' className="a1">
        <Grid container item  direction='column' justify='center' xs={12} sm={12} md={12} lg={6} className="a2">
          <Grid item>
            <Box className='a3'>
            <Typography className='a4' variant="h1">One-to-one online tuitions from home</Typography>
            </Box>
          </Grid>
        </Grid>
        <Grid  container item  direction='column' justify='center' xs={12} sm={12} md={12} lg={6}>
          <Paper >World</Paper>
        </Grid>
        </Grid>
     <style global jsx>{`
     .a1{
      margin-top: 0;
      margin-left: 0;
      margin-rigth: 0;
     }
     .a2{
      min-height: 65vh;
      padding-left: 48px;
      padding-right: 8px;
      background-color: #181357;
     }
     .a3{

     }
     .a4{
        color: #eb59ae;
     }

     @media (min-width: 0px){
      .a3 {
        text-align: center;
        }
    }
    @media (min-width: 480px)
      {.a3 {
    text-align: center;
    }}
   
    @media (min-width: 576px)
      {.a3 {
    text-align: left;
    }}
    @media (min-width: 992px)
{
.a4 {
    font-size: 4.125rem;
    font-weight: 900;
    line-height: 4.75rem;
}
}
     `}</style>
    </div>)
}

export default about;
